import './App.css';
import Home from './screens/Home/home.js';
import Layout from './components/Layout/Layout'
import {Route, Routes} from 'react-router-dom'

function App() {
  return (
    <div>
      <Layout>
        <Routes>
        <Route exact path="/" element={<Home user={user} />} />
        </Routes>
      </Layout>
    </div>
  );
}

export default App;
